webpackJsonp([0x87a595ba97bf],{351:function(e,t){e.exports={data:{markdownRemark:{html:'<h1>Kinectron</h1>\n<h2>A Realtime Peer Server for Kinect 2</h2>\n<blockquote>\n<p><a href="http://lisajamhoury.com/">Lisa Jamhoury</a>, ITP 2017<br>\n<a href="https://github.com/vanevery">Shawn Van Every</a>, ITP  </p>\n<blockquote>\n<p>Additional collaborators: <a href="http://anothersideproject.co/">Stephanie Koltun</a>, <a href="www.orfleisher.com">Or Fleisher</a> and <a href="http://montoyamoraga.io/">Aar√≥n Montoya-Moraga</a>  </p>\n</blockquote>\n</blockquote>\n<blockquote>\n<p>2017</p>\n</blockquote>\n<p>Kinectron is a node-based library that broadcasts Kinect2 data over a peer connection. It builds on the Node Kinect2 and PeerJS libraries.<br>\nKinectron sends Kinect depth, color and skeletal data over a peer network. It can be used in a number of ways.<br>\nKinectron has two components--an electron application to broadcast Kinect2 data over a peer connection, and a client-side API to request and receive Kinect2 data over a peer connection.  </p>\n<p><a class="btn btn-outline-primary" href="https://kinectron.github.io/" role="button">Project Page</a>   <a class="btn btn-outline-primary" href="https://github.com/kinectron/kinectron" role="button">GitHub Repository</a>  </p>',frontmatter:{title:"Kinectron",date:"May 23, 2018",path:"/kinectron",tags:["Tool"],excerpt:"Kinectron is a node-based library that broadcasts Kinect2 data over a peer connection. It builds on the Node Kinect2 and PeerJS libraries."}}},pathContext:{prev:{html:'<h1>Gravity</h1>\n<h2>Immersive installation</h2>\n<blockquote>\n<p><a href="http://wangxinyao-design.com/">Xinyao Wang</a><br>\n2017</p>\n</blockquote>\n<iframe src="https://player.vimeo.com/video/216230174" width="640" height="360" frameborder="0" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe>\n<p><a href="https://vimeo.com/216230174">Gravity</a> from <a href="https://vimeo.com/user33557684">Xinyao Wang</a> on <a href="https://vimeo.com">Vimeo</a>.</p>\n<p>Gravity allows users to play in an magical version of mundane moments, where their movements can control the rules of physics. Combining simplified motion-capture suits, indoor position and projection mapping technology, users move their bodies to control objects in zero gravity. Working together they can change the world visually and aurally.</p>\n<p>Toolkit: Unreal Engine, Openframework, Kinect, OSC, Socket.io, Android Studio, Syphon, Spout, TCP Syphon, TCP Spout, Motion Capture Suit, Resolume.\n<br>\n<a class="btn btn-outline-primary" href="https://annekgoodfriend.github.io/Bootstrap_villageLIVE/" role="button">Project Page</a></p>',id:"/home/travis/build/ITP-Xstory/website/src/pages/projects/gravity.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2017-01-30T12:34:00+00:00",thumbnail:"http://wangxinyao-design.com/images/world.gif",path:"/gravity",title:"Gravity",excerpt:"Gravity allows users to play in an magical version of mundane moments, where their movements can control the rules of physics.",tags:["Experience","Immersive"]}},next:{html:'<h1>Skeletron</h1>\n<h2>Predicting human pose in 3D using any camera</h2>\n<blockquote>\n<p><a href="www.orfleisher.com">Or Fleisher</a>, ITP 2018<br>\n<a href="www.drorayalon.com">Dror Ayalon</a>, ITP 2018<br>\n2018</p>\n</blockquote>\n<iframe width="560" height="315" src="https://www.youtube.com/embed/l_owi316cE8" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen></iframe>\n<p>Skeletron is a system that predicts joints and human skeleton position in 3d from real-time video taken by any (cheap) RGB camera, such as a webcam. The system sends the data about the position of the human body to Unity, a 3D game development engine, to allow engineers, artists, and creative technologists to use it to develop digital experiences.</p>\n<p>INGREDIENTS</p>\n<ul>\n<li>Machine Learning Model - <a href="http://gvv.mpi-inf.mpg.de/projects/VNect/">http://gvv.mpi-inf.mpg.de/projects/VNect/</a>  </li>\n<li>TensorFlow port - <a href="https://github.com/timctho/VNect-tensorflow">https://github.com/timctho/VNect-tensorflow</a>  </li>\n<li>Model prediction - Google TensorFlow  </li>\n<li>Data representation in 3D - <a href="https://unity3d.com/">https://unity3d.com/</a>  </li>\n</ul>\n<h4>Press</h4>\n<blockquote>\n<p>"Programmers use TensorFlow AI to turn any webcam into Microsoft Kinect"<br>\n<a href="https://thenextweb.com/artificial-intelligence/2018/01/30/programmers-use-tensorflow-ai-to-turn-any-webcam-into-microsoft-kinect/">View article on thenextweb.com</a> </p>\n</blockquote>\n<blockquote>\n<p>"Two AI developers have turned a simple webcam into a system that behaves just like a Microsoft Kinect using machine learning"<br>\n<a href="https://www.techradar.com/news/ai-developers-can-turn-any-webcam-into-a-kinect">View article on techradar.com</a></p>\n</blockquote>\n<br>\n<a class="btn btn-outline-primary" href="http://orfleisher.com/portfolio-item/skeletron/" role="button">Project Page</a>',id:"/home/travis/build/ITP-Xstory/website/src/pages/projects/skeletron.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2018-01-30T12:34:00+00:00",thumbnail:"http://orfleisher.com/wp-content/uploads/2018/01/s.gif",path:"/skeletron",title:"Skeletron",excerpt:"Skeletron is a system that predicts joints and human skeleton position in 3d from real-time video taken by any (cheap) RGB camera",tags:["Machine Learning","Tool","Immersive","3D"]}}}}}});
